import React from "react";


const User = ({ usuario }) => (

<div className="repoListContainer">
   <div>
   <img src="{{usuario.avatar_url}}"/>
   </div>
  <lu>
   <li>{usuario.followers}</li>
   <li>{usuario.following}</li>
   <li>{usuario.email}</li>
   <li>{usuario.bio}</li>
   </lu>
  
</div>


);




export default User;
